    console.log('players');
    console.log(players);
    return (
    <div className="playTable">
        {trick ? (
        <div>
            <div className="activeContainer">
                {trick.map ((card) => (
                    <TrickCard card={card} player={players[0] ? players[0] : 'empty Chair'}/>
                   // console.log('user in room: ' + user.name)
                ))}
            </div>
        </div>
        ) : null }
    </div>
    )
};


export default PlayTable;
